ATINY, if you recently bought and received ATEEZ albums from places like MyMusicTaste, ChoiceMusicLa, etc and received a pink Hanteo Chart Authentication card, this means your album has not been registered and hasn’t be counted for the Hanteo chart.

Register your ATEEZ album using the 
@Whosfan_HANTEO App, Verify and scan the QR code using your smartphone camera
